import React from 'react';
import {Reponse} from '../components/textInput'

let str;
let premierMot="Lol"
let deuxiemeMot="fin"
const Service1_1 = () => {
    return (
      <div
      style={{
        display: 'flex',  justifyContent:'center', alignItems:'center', height: '100vh',flexDirection:'column'
      }}>
        <div>
           {Reponse}
           {test()}   
           <mark>test</mark>
      </div>
      
    </div>
    );
  };
  
  function test(){
    str=Reponse.toString().substr(0, 1);
    
    return str+"test";
  }

  export default Service1_1;
